// N8n Function node kodi
let cycleInput;

try {
  cycleInput =  $json["result"] 

} catch (e) {
    cycleInput = $input.first().json.body;
}
const eventMapping = {
  1: {
    1: ["DS_OFF", "Ishdan tashqari"],
    2: ["DS_SB", "Uxlayapti yoki dam"],
    3: ["DS_D", "Haydash jarayonida"],
    4: ["DS_ON", "Ish holati, haydamaydi"],
  },
  2: {
    1: ["INTER_NORMAL_PRECISION", "To'liq joylashuv"],
    2: ["INTER_REDUCED_PRECISION", "Noaniq joylashuv"],
  },
  3: {
    1: ["PS_USE", "Shaxsiy foydalanish"],
    2: ["YRD_MOVE", "Yard ichida harakat"],
    0: ["PS_CLEAR", "Shaxsiy rejim bekor"],
  },
  4: {
    1: ["DR_CERT_1", "1-tasdiqlash"],
    2: ["DR_CERT_2", "2-tasdiqlash"],
    3: ["DR_CERT_3", "3-tasdiqlash"],
    4: ["DR_CERT_4", "4-tasdiqlash"],
    5: ["DR_CERT_5", "5-tasdiqlash"],
    6: ["DR_CERT_6", "6-tasdiqlash"],
    7: ["DR_CERT_7", "7-tasdiqlash"],
    8: ["DR_CERT_8", "8-tasdiqlash"],
    9: ["DR_CERT_9", "9-tasdiqlash"],
  },
  5: {
    1: ["DR_LOGIN", "Haydovchi tizimga kirdi"],
    2: ["DR_LOGOUT", "Haydovchi tizimdan chiqdi"],
  },
  6: {
    1: ["ENG_UP_NORMAL", "Motor ishga tushdi (GPS aniq)"],
    2: ["ENG_UP_REDUCED", "Motor ishga tushdi (GPS noaniq)"],
    3: ["ENG_DOWN_NORMAL", "Motor o'chirildi (GPS aniq)"],
    4: ["ENG_DOWN_REDUCED", "Motor o'chirildi (GPS noaniq)"],
  },
  7: {
    1: ["MALF_LOGGED", "Nosozlik qayd etildi"],
    2: ["MALF_CLEARED", "Nosozlik bartaraf qilindi"],
    3: ["DIAG_LOGGED", "Diagnostika xatosi bor"],
    4: ["DIAG_CLEARED", "Diagnostika tuzatildi"],
  }
};

// Eventni qayta ishlash funksiyasi
function processEvent(event) {
  const type = event.eventType;
  const code = event.eventCode;
  let eventName = "";
  let eventDesc = "";

  if (eventMapping[type] && eventMapping[type][code]) {
    eventName = eventMapping[type][code][0];
    eventDesc = eventMapping[type][code][1];
  } else {
    eventName = event.eventCodeDescription || `UNKNOWN_${type}_${code}`;
    eventDesc = event.eventTypeDescription || "Noma'lum holat";
  }

  return {
    dateTime: event.dateTime,
    durationInSeconds: event.durationInSeconds,
    event: eventName,
    eventDescription: eventDesc,
    longitude: event.longitude,
    latitude: event.latitude,
    calculatedLocation: event.calculatedLocation,
    manualLocation: event.manualLocation || '',
    totalEngineHours: event.totalEngineHours || 0,
    totalVehicleMiles: event.totalVehicleMiles
  };
}

// Asosiy transformatsiya
let result;

if (cycleInput.shifts && Array.isArray(cycleInput.shifts)) {
  // Cycle uchun
  const shiftsArray = cycleInput.shifts.map(shift => {
    const shiftObj = {};

    if (shift.type === 0 && shift.events && Array.isArray(shift.events)) {
      shiftObj.shift = shift.events.map(processEvent);
    }

    if (shift.type === 1 && shift.events && Array.isArray(shift.events)) {
      shiftObj.shift_rest = shift.events.map(processEvent);
    }

    return Object.keys(shiftObj).length > 0 ? shiftObj : {};
  }).filter(shift => Object.keys(shift).length > 0);

  result = {
    cycle_type: 'cycle',
    shifts: shiftsArray
  };
} else if (cycleInput.events && Array.isArray(cycleInput.events)) {
  // Cycle_rest uchun
  const processedEvents = cycleInput.events.map(processEvent);

  result = {
    cycle_type: 'cycle_rest',
    events: processedEvents
  };
} else {
  result = {};
}

// Natijani qaytarish
return [{ json: { result } }];

const items = [{ json: {} }];

const inputItem = $input.first();

if (inputItem && inputItem.json && inputItem.json.output) {
  const rawText = inputItem.json.output;

  // AI javobidan JSON qismini ajratib olish
  const extractJSON = (text) => {
    // 1. Avvalo ```json ... ``` blokini qidirish
    const jsonBlockMatch = text.match(/```json\s*([\s\S]*?)\s*```/i);
    if (jsonBlockMatch) {
      return jsonBlockMatch[1].trim();
    }

    // 2. Oddiy ``` ... ``` blokini qidirish
    const codeBlockMatch = text.match(/```\s*([\s\S]*?)\s*```/);
    if (codeBlockMatch) {
      return codeBlockMatch[1].trim();
    }

    // 3. { bilan boshlanadigan va } bilan tugaydigan qismni qidirish
    const jsonObjectMatch = text.match(/\{\s*"cycle_violations"[\s\S]*\}/);
    if (jsonObjectMatch) {
      return jsonObjectMatch[0];
    }

    // 4. Oxirgi imkoniyat: { ... } qidirish
    const lastMatch = text.match(/\{[\s\S]*\}/);
    return lastMatch ? lastMatch[0] : text;
  };

  const jsonString = extractJSON(rawText);

  try {
    const parsed = JSON.parse(jsonString);

    // Standard formatga o'tkazish
    const violations = Array.isArray(parsed.cycle_violations) ? parsed.cycle_violations : [];

    // Har bir violationni validate qilish
    const validatedViolations = violations.filter(violation => 
      violation && 
      typeof violation === 'object' &&
      violation.violation &&
      violation.dateTimeStart &&
      violation.dateTimeEnd
    ).map(violation => ({
      violation: String(violation.violation || ''),
      dateTimeStart: String(violation.dateTimeStart || ''),
      dateTimeEnd: String(violation.dateTimeEnd || ''),
      description: String(violation.description || ''),
      overtime: typeof violation.overtime === 'number' ? violation.overtime : 0
    }));

    items[0].json = {
      cycle_violations: validatedViolations,

    };

  } catch (error) {
    console.error("FMCSA JSON parse xatosi:", error, "\nText:", jsonString);

    items[0].json = {
      cycle_violations: [],




      raw_text_sample: rawText.substring(0, 500)
    };
  }
} else {
  items[0].json = {
    cycle_violations: [],




  };
}

return { items };

